import React from "react";
import {
  ContainerPhoneBook,
  TitlePhoneBook,
  Labe,
  Input,
} from "./Filter.styled";

const Filter = ({ value, onChange }) => (
  <ContainerPhoneBook>
    <TitlePhoneBook>Contacts</TitlePhoneBook>
    <Labe>
      Find contacts by name
      <Input
        type="text"
        placeholder="Enter name"
        value={this.state.name}
        onChange={this.handelChange}
      />
    </Labe>
  </ContainerPhoneBook>
);
export default Filter;
